package org.pu.erp.module.vendor.bean;

public class SaveVendorRequestBean {
	
	private Vendor newVendor;
	private Vendor searchVendor;
	private String opind;
	
	public Vendor getNewVendor() {
		return newVendor;
	}
	public void setNewVendor(Vendor newVendor) {
		this.newVendor = newVendor;
	}
	public Vendor getSearchVendor() {
		return searchVendor;
	}
	public void setSearchVendor(Vendor searchVendor) {
		this.searchVendor = searchVendor;
	}
	public String getOpind() {
		return opind;
	}
	public void setOpind(String opind) {
		this.opind = opind;
	}
	
	
	
	

}
